import React from "react";

import { Container, Card, Header } from "semantic-ui-react";
import Jumbotron from "react-bootstrap/Jumbotron";

export default function Home() {
  return (
    <Container textAlign="center">
      <Jumbotron>
        <Header>
      </Header></Jumbotron>
    </Container>
  );
}
